import React from 'react';

const User = ({ username, id, password, created_at }) => {
  return (
    <div className='user-display'>
      <p>Username: {username}</p>
      <p>User ID: {id}</p>
      <p>User Password: {password}</p>
      <p>User Created At: {created_at}</p>
      <input placeholder='Update User'>Edit User Info</input>
    </div>
  )
}

export default User;
